    const [load, setLoad] = useState(false)

  const data = [
    {id:"A1", name:'BMW', price:'90000', image:bmw},
    {id:"A2", name:'BENZ', price:'110000', image: benz},

]


    return (
        <div className="main">

        {/* // / BOX 1 ///  */}
            <div className="main-box">
            {data.map(ev => 
            <>
            <div className="main-box1" key={ev.id}>
                <img src={ev.image} />
                <p>{ev.name}</p>
                <p>{ev.price}</p>
